import Header from "../../components/Header";
import React, { useState } from 'react';
import { QrReader } from 'react-qr-reader';

const Test = (props) => {
    const [data, setData] = useState('No result');

    return (
        <>
        <QrReader
            onResult={(result, error) => {
            if (!!result) {
                setData(result?.text);
            }

            if (!!error) {
                console.info(error);
            }
            }}
            style={{ width: '100%' }}
        />
        <p>{data}</p>
        </>
    );
};


const PresensiPage = () => {
    return(
        <div>
            <Header/>
            <Test/>
        </div>
    )
}

export default PresensiPage
